import React from 'react';
import styled from 'styled-components';

const AnalysisTable = ({ tableData }) => {
  const getHeader = () => {
    if (this.props.isEdit && tableData && tableData.length) {
      let headers = ['', 'Edited', 'Previous'];
      console.log(headers, 'headers');
      return headers.map((header, index) => {
        return <th key={index}>{header}</th>;
      });
    }
  };
  return (
    <Styles>
      <table style={{ width: '137%' }}>
        <tbody>
          <tr>{getHeader()}</tr>
          {this.props.isEdit && tableData.length && tableData.length > 0 ? (
            tableData.map((cell, index) => {
              return (
                <tr key={index}>
                  <td className="cellAlign" style={{ backgroundColor: '#e8eef2' }}>
                    {cell.style_id}
                  </td>
                  <td className="cellData">{cell.style_desc}</td>
                </tr>
              );
            })
          ) : (
            <tr>
              <td colSpan="5">Loading...</td>
            </tr>
          )}
        </tbody>
      </table>
    </Styles>
  );
};

export default AnalysisTable;

const Styles = styled.table`
  font-family: arial, sans-serif;
  border-collapse: collapse;
  width: 100%;

  td,
  th {
    border: 1px solid #dddddd;
    text-align: center;
    padding: 8px;
  }
  tr {
    font-size: 15px;
    line-height: 4rem;
    font-size: 15px;
    color: #3c4148;
    font-weight: 500;
    // background-color: #e8eef2;
  }
`;
